import React from "react";
import { Line, Bar } from "react-chartjs-2";
const Presentation = (props) => {
  const { dailyData } = props;
  const linChart = dailyData ? (
    <Line
      data={{
        labels: dailyData.map(({ date }) => date),
      }}
    />
  ) : null;
  return (
    <div>
      <h1>heloo</h1>
      {linChart}
    </div>
  );
};

export default Presentation;
